  false,\n\t\"url\": null,\n\t\"notes\": \"TASK NAME: USGS Olympic Peninsula Washington
  LIDAR LiDAR Data Acquisition and Processing Production Task USGS Contract No. G10PC00057
  Task Order No. G13PD00849 Woolpert Order No. 073622 CONTRACTOR: Woolpert, Inc. This
  data set is comprised of LiDAR point cloud data, raster DEM, raster DSM, hydrologic
  3-d breaklines, raster intensity, survey control, project tile index, and project
  data extent, which encompasses approximately 437 square miles along with a 100 meter
  buffer of the Olympic Peninsula in the counties of Jefferson and Clallam in north-western
  coastal Washington. LiDAR data is a remotely sensed high resolution elevation data
  collected by an airborne platform. The LiDAR sensor uses a combination of laser
  range finding, GPS positioning, and inertial measurement technologies. The LiDAR
  systems collect data point clouds that are used to produce highly detailed Digital
  Elevation Models (DEMs) of the earth's terrain, man-made structures, and vegetation.
  The task required the LiDAR data to be collected at a nominal pulse spacing (NPS)
  of 0.35m. The final products include classified LAS, one (1) meter pixel raster
  DEMs of the bare-earth surface in ERDAS IMG Format, 1 meter pixel raster DSMs of
  the first return pulses in ERDAS IMG Format, one (1) meter pixel raster 8-bit intensity
  images. Each LAS file contains lidar point information, which has been calibrated,
  controlled, and classified. Additional deliverables include hydrologic breakline
  data, control data, tile index, lidar processing and survey reports in PDF format,
  FGDC metadata files for each data deliverable in .xml format, and LAS swath data.
  Collected swath files that were that were larger than 2GB were provided in multiple
  sub-swath files, each less than 2GB. Ground conditions: Water at normal levels;
  no unusual inundation; no snow; leaf off.\",\n\t\"license_title\": null,\n\t\"extras\":
